/// Creates a [GlobalCupertinoLocalizations] instance for the given `locale`.
///
/// All of the function's arguments except `locale` will be passed to the [new
/// GlobalCupertinoLocalizations] constructor. (The `localeName` argument of that
/// constructor is specified by the actual subclass constructor by this
/// function.)
///
/// The following locales are supported by this package:
///
/// {@template flutter.localizations.languages}
///  * `ar` - Arabic
///  * `bg` - Bulgarian
///  * `bs` - Bosnian
///  * `ca` - Catalan Valencian
///  * `cs` - Czech
///  * `da` - Danish
///  * `de` - German (plus one country variation)
///  * `el` - Modern Greek
///  * `en` - English (plus 7 country variations)
///  * `es` - Spanish Castilian (plus 20 country variations)
///  * `et` - Estonian
///  * `fa` - Persian
///  * `fi` - Finnish
///  * `fil` - Filipino Pilipino
///  * `fr` - French (plus one country variation)
///  * `gsw` - Swiss German Alemannic Alsatian
///  * `he` - Hebrew
///  * `hi` - Hindi
///  * `hr` - Croatian
///  * `hu` - Hungarian
///  * `id` - Indonesian
///  * `it` - Italian
///  * `ja` - Japanese
///  * `km` - Khmer Central Khmer
///  * `ko` - Korean
///  * `lt` - Lithuanian
///  * `lv` - Latvian
///  * `mn` - Mongolian
///  * `mr` - Marathi
///  * `ms` - Malay
///  * `nb` - Norwegian Bokmål
///  * `nl` - Dutch Flemish
///  * `pl` - Polish
///  * `ps` - Pushto Pashto
///  * `pt` - Portuguese (plus one country variation)
///  * `ro` - Romanian Moldavian Moldovan
///  * `ru` - Russian
///  * `sk` - Slovak
///  * `sl` - Slovenian
///  * `sr` - Serbian (plus 2 scripts)
///  * `sv` - Swedish
///  * `ta` - Tamil
///  * `th` - Thai
///  * `tl` - Tagalog
///  * `tr` - Turkish
///  * `uk` - Ukrainian
///  * `ur` - Urdu
///  * `vi` - Vietnamese
///  * `zh` - Chinese (plus 2 country variations and 2 scripts)
/// {@endtemplate}
///
/// Generally speaking, this method is only intended to be used by
/// [GlobalCupertinoLocalizations.delegate].
GlobalCupertinoLocalizations getCupertinoTranslation(
  Locale locale,
) {
  switch (locale.languageCode) {
    case 'ar':
      return CupertinoLocalizationAr(locale: locale);
    case 'bg':
      return CupertinoLocalizationBg(locale: locale);
    case 'bs':
      return CupertinoLocalizationBs(locale: locale);
    case 'ca':
      return CupertinoLocalizationCa(locale: locale);
    case 'cs':
      return CupertinoLocalizationCs(locale: locale);
    case 'da':
      return CupertinoLocalizationDa(locale: locale);
    case 'de':
      {
        switch (locale.countryCode) {
          case 'CH':
            return CupertinoLocalizationDeCh(locale: locale);
        }
        return CupertinoLocalizationDe(locale: locale);
      }
    case 'el':
      return CupertinoLocalizationEl(locale: locale);
    case 'en':
      {
        switch (locale.countryCode) {
          case 'AU':
            return CupertinoLocalizationEnAu(locale: locale);
          case 'CA':
            return CupertinoLocalizationEnCa(locale: locale);
          case 'GB':
            return CupertinoLocalizationEnGb(locale: locale);
          case 'IE':
            return CupertinoLocalizationEnIe(locale: locale);
          case 'IN':
            return CupertinoLocalizationEnIn(locale: locale);
          case 'SG':
            return CupertinoLocalizationEnSg(locale: locale);
          case 'ZA':
            return CupertinoLocalizationEnZa(locale: locale);
        }
        return CupertinoLocalizationEn(locale: locale);
      }
    case 'es':
      {
        switch (locale.countryCode) {
          case '419':
            return CupertinoLocalizationEs419(locale: locale);
          case 'AR':
            return CupertinoLocalizationEsAr(locale: locale);
          case 'BO':
            return CupertinoLocalizationEsBo(locale: locale);
          case 'CL':
            return CupertinoLocalizationEsCl(locale: locale);
          case 'CO':
            return CupertinoLocalizationEsCo(locale: locale);
          case 'CR':
            return CupertinoLocalizationEsCr(locale: locale);
          case 'DO':
            return CupertinoLocalizationEsDo(locale: locale);
          case 'EC':
            return CupertinoLocalizationEsEc(locale: locale);
          case 'GT':
            return CupertinoLocalizationEsGt(locale: locale);
          case 'HN':
            return CupertinoLocalizationEsHn(locale: locale);
          case 'MX':
            return CupertinoLocalizationEsMx(locale: locale);
          case 'NI':
            return CupertinoLocalizationEsNi(locale: locale);
          case 'PA':
            return CupertinoLocalizationEsPa(locale: locale);
          case 'PE':
            return CupertinoLocalizationEsPe(locale: locale);
          case 'PR':
            return CupertinoLocalizationEsPr(locale: locale);
          case 'PY':
            return CupertinoLocalizationEsPy(locale: locale);
          case 'SV':
            return CupertinoLocalizationEsSv(locale: locale);
          case 'US':
            return CupertinoLocalizationEsUs(locale: locale);
          case 'UY':
            return CupertinoLocalizationEsUy(locale: locale);
          case 'VE':
            return CupertinoLocalizationEsVe(locale: locale);
        }
        return CupertinoLocalizationEs(locale: locale);
      }
    case 'et':
      return CupertinoLocalizationEt(locale: locale);
    case 'fa':
      return CupertinoLocalizationFa(locale: locale);
    case 'fi':
      return CupertinoLocalizationFi(locale: locale);
    case 'fil':
      return CupertinoLocalizationFil(locale: locale);
    case 'fr':
      {
        switch (locale.countryCode) {
          case 'CA':
            return CupertinoLocalizationFrCa(locale: locale);
        }
        return CupertinoLocalizationFr(locale: locale);
      }
    case 'gsw':
      return CupertinoLocalizationGsw(locale: locale);
    case 'he':
      return CupertinoLocalizationHe(locale: locale);
    case 'hi':
      return CupertinoLocalizationHi(locale: locale);
    case 'hr':
      return CupertinoLocalizationHr(locale: locale);
    case 'hu':
      return CupertinoLocalizationHu(locale: locale);
    case 'id':
      return CupertinoLocalizationId(locale: locale);
    case 'it':
      return CupertinoLocalizationIt(locale: locale);
    case 'ja':
      return CupertinoLocalizationJa(locale: locale);
    case 'km':
      return CupertinoLocalizationKm(locale: locale);
    case 'ko':
      return CupertinoLocalizationKo(locale: locale);
    case 'lt':
      return CupertinoLocalizationLt(locale: locale);
    case 'lv':
      return CupertinoLocalizationLv(locale: locale);
    case 'mn':
      return CupertinoLocalizationMn(locale: locale);
    case 'mr':
      return CupertinoLocalizationMr(locale: locale);
    case 'ms':
      return CupertinoLocalizationMs(locale: locale);
    case 'nb':
      return CupertinoLocalizationNb(locale: locale);
    case 'nl':
      return CupertinoLocalizationNl(locale: locale);
    case 'pl':
      return CupertinoLocalizationPl(locale: locale);
    case 'ps':
      return CupertinoLocalizationPs(locale: locale);
    case 'pt':
      {
        switch (locale.countryCode) {
          case 'PT':
            return CupertinoLocalizationPtPt(locale: locale);
        }
        return CupertinoLocalizationPt(locale: locale);
      }
    case 'ro':
      return CupertinoLocalizationRo(locale: locale);
    case 'ru':
      return CupertinoLocalizationRu(locale: locale);
    case 'sk':
      return CupertinoLocalizationSk(locale: locale);
    case 'sl':
      return CupertinoLocalizationSl(locale: locale);
    case 'sr':
      {
        switch (locale.scriptCode) {
          case 'Cyrl':
            {
              return CupertinoLocalizationSrCyrl(locale: locale);
            }
          case 'Latn':
            {
              return CupertinoLocalizationSrLatn(locale: locale);
            }
        }
        return CupertinoLocalizationSr(locale: locale);
      }
    case 'sv':
      return CupertinoLocalizationSv(locale: locale);
    case 'ta':
      return CupertinoLocalizationTa(locale: locale);
    case 'th':
      return CupertinoLocalizationTh(locale: locale);
    case 'tl':
      return CupertinoLocalizationTl(locale: locale);
    case 'tr':
      return CupertinoLocalizationTr(locale: locale);
    case 'uk':
      return CupertinoLocalizationUk(locale: locale);
    case 'ur':
      return CupertinoLocalizationUr(locale: locale);
    case 'vi':
      return CupertinoLocalizationVi(locale: locale);
    case 'zh':
      {
        switch (locale.scriptCode) {
          case 'Hans':
            {
              return CupertinoLocalizationZhHans(locale: locale);
            }
          case 'Hant':
            {
              switch (locale.countryCode) {
                case 'HK':
                  return CupertinoLocalizationZhHantHk(locale: locale);
                case 'TW':
                  return CupertinoLocalizationZhHantTw(locale: locale);
              }
              return CupertinoLocalizationZhHant(locale: locale);
            }
        }
        switch (locale.countryCode) {
          case 'HK':
            return CupertinoLocalizationZhHantHk(locale: locale);
          case 'TW':
            return CupertinoLocalizationZhHantTw(locale: locale);
        }
        return CupertinoLocalizationZh(locale: locale);
      }
  }
  assert(false, 'getTranslation() called for unsupported locale "$locale"');
  return null;
}
